import Model from './components/Rock/rock'

function App() {

  return (

    <div className="App">
      <CanvasContainer>
      <Canvas colorManagement 
      shadowMap
      Camera={{position: [-5,4,4], fov: 40}}>
        <Suspense fallback={null}>
        <Model/>

        </Suspense> 

       </Canvas>

        </CanvasContainer> 

    </div>
  );
}

  const CanvasContainer = styled.div`
  width: 100%;
  height: 100%; 
  `; 

export default App;
